script: |
  super -f text -I q1252.spq | sort > q1252.out

inputs:
  - name: q1252.spq
    data: |
      SELECT - + col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col2 / - ( - col0 ) + + col0 + col2 * 96 * + + ( + col0 ) + + col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q1252.out
    data: |
